import {LoadUserProfile} from '../../../services/User/ProfileService'
import {GetPossibleConnections} from '../../../services/User/ProfileService'


export const loadUserAction = () =>{
    return (dispatch)=>{

        dispatch({type:'LOADING'});

        LoadUserProfile().then((res)=>{

            if(res.hasOwnProperty('success') && res.success==true){

                dispatch({type:'LOAD_PROFILE_SUCCESS',res});

            }else if(res.hasOwnProperty('success') && res.success==false) { 
                dispatch({type:'LOAD_PROFILE_ERROR',res})
            }
        },
        error=>{
            dispatch({type:'CODE_ERROR',error});
        }
        )
    }

}


export const loadConnectionsAction = () =>{
    return (dispatch)=>{

        //dispatch({type:'LOADING'});

        GetPossibleConnections().then((res)=>{

            if(res.hasOwnProperty('success') && res.success==true){

                dispatch({type:'GET_USERS_SUCCESS',res});

            }else if(res.hasOwnProperty('success') && res.success==false) { 
                dispatch({type:'GET_USERS_ERROR',res})
            }
        },
        error=>{
            dispatch({type:'CODE_ERROR',error});
        }
        )
    }

}
